Разработать программу, моделирующую "жизнь" сети аэропортов, регламентируемую следующими правилами.
Время дискретно. Каждый аэропорт имеет следующие характеристики: пространственные координаты, одну взлетно-посадочную полосу, количество стоянок для самолетов. За один шаг по времени аэропорт может осуществлять либо посадку, либо взлет одного самолета.
Любой самолет имеет следующие характеристики: вес заправленного самолета, скорость, максимальное время продолжительности полета, время, необходимое для обслуживания самолета на стоянке. Полет происходит всегда из одного аэропорта в другой.
Самолеты делятся на самолеты с полезным грузом и самолеты без груза (военные, прогулочные). Время полета самолета с грузом уменьшается пропорционально фактическому полному весу самолета.
Самолеты с грузом бывают пассажирские и транспортные. У пассажирских самолетов имеется дополнительный параметр - количество мест. У транспортных - максимальный вес груза.
Через случайные промежутки времени самолеты прибывают из других аэропортов и запрашивают разрешение на посадку у диспетчера. Диспетчер выдает разрешение на посадку, если взлетно-посадочная полоса в настоящий момент не занята садящимся или взлетающим самолетом и количество приземлившихся самолетов не превышает вместимость аэропорта.
Самолет терпит крушение в случае, если время полета превышено, а диспетчер так и не выдал разрешения на посадку. Разрешения на посадку выдаются в следующем порядке - сначала самолеты с минимальным остатком времени полета, затем пассажирские, затем все остальные. Разрешение на посадку не выдается, если все стоянки заняты.
У самолета на стоянке аэропорт назначения задается случайно. Масса груза или количество занятых мест также задается случайно непосредственно перед вылетом.
На каждом шаге по времени  пользователь может вывести следующую информацию:
	- список самолетов в воздухе;
	- список самолетов, остаток времени полета которых не превышает заданную величину;
	- список самолетов на стоянке любого аэропорта;
	- информацию всех предыдущих пунктов можно получить для любого типа самолета;
	- количество пассажиров в полете;
	- общая масса перевозимого груза;
	- общее количество самолетов, потерпевших крушение, количество погибших пассажиров и количество потерянного груза.
